import React from 'react';

function SwapComponent({ walletAddress }) {
  return (
    <div>
      <h2>Swap Component</h2>
      <p>Wallet address: {walletAddress}</p>
      {/* Komponen swap lainnya nanti menyusul */}
    </div>
  );
}

export default SwapComponent;
